import React from 'react'
import { FlatList } from 'react-native'
import Question from '../components/Question'

export default function ExercisesScreen(){
    return(
        <FlatList 
            data = {[{title: 'Question 1'}, {title: 'Question: 2'}]}
            renderItem = {({item}) =>
                <Question title={item.title}/>
            }
        />
    )
}
